import React from 'react';
import type { Fixture } from '../types';
import type { SimpleFixture } from '../services/supabase-simple';

interface FixtureCardProps {
  fixture: Fixture | SimpleFixture;
  blackoutIds?: number[];
}

// Type guard to check if fixture is a Fixture (full data) or SimpleFixture
const isFullFixture = (fixture: Fixture | SimpleFixture): fixture is Fixture => {
  return 'providers_uk' in fixture;
};

const FixtureCard: React.FC<FixtureCardProps> = ({ fixture, blackoutIds = [] }) => {
  const kickoffDate = new Date(fixture.kickoff_utc);
  const isValidDate = !isNaN(kickoffDate.getTime());

  const formatDateTime = () => {
    if (!isValidDate) return 'TBD';

    const options: Intl.DateTimeFormatOptions = {
      weekday: 'short',
      month: 'short', 
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit',
      timeZone: 'Europe/London'
    };

    return kickoffDate.toLocaleDateString('en-GB', options);
  };

  const getBroadcasterInfo = () => {
    // Check for blackout from localStorage first
    if (blackoutIds.includes(fixture.id)) {
      return <span className="provider blackout">ðŸš« Blackout</span>;
    }

    if (isFullFixture(fixture)) {
      // Full fixture data from fixtures page
      if (fixture.blackout?.is_blackout) {
        return <span className="provider blackout">ðŸš« Blackout</span>;
      }

      if (fixture.providers_uk.length === 0) {
        return <span className="tbd-text">TBD</span>;
      }

      return fixture.providers_uk.map(provider => (
        <span 
          key={provider.id} 
          className={`provider confirmed ${provider.type}`}
          title={provider.type}
        >
          {provider.name}
        </span>
      ));
    } else {
      // Simple fixture data from home page
      return fixture.broadcaster ? (
        <span className="provider confirmed">{fixture.broadcaster}</span>
      ) : (
        <span className="tbd-text">TBD</span>
      );
    }
  };

  const getTeamData = () => {
    if (isFullFixture(fixture)) {
      return {
        home: { name: fixture.home.name, crest: fixture.home.crest },
        away: { name: fixture.away.name, crest: fixture.away.crest }
      };
    } else {
      return {
        home: { name: fixture.home_team, crest: null },
        away: { name: fixture.away_team, crest: null }
      };
    }
  };

  const { home, away } = getTeamData();
  const matchweek = isFullFixture(fixture) ? fixture.matchweek : fixture.matchweek;

  return (
    <div className="fixture-card">
      <div className="fixture-datetime">
        {formatDateTime()}
        {matchweek && (
          <div style={{ fontSize: '12px', color: '#6b7280', marginTop: '2px' }}>
            MW {matchweek}
          </div>
        )}
      </div>

      <div className="fixture-teams">
        <div className="team">
          {home.crest && (
            <img 
              src={home.crest} 
              alt={`${home.name} crest`}
              style={{ width: '20px', height: '20px', marginRight: '8px', objectFit: 'contain' }}
            />
          )}
          <span className="team-name">{home.name}</span>
        </div>

        <div className="vs">vs</div>

        <div className="team away-team">
          <span className="team-name">{away.name}</span>
          {away.crest && (
            <img 
              src={away.crest} 
              alt={`${away.name} crest`}
              style={{ width: '20px', height: '20px', marginLeft: '8px', objectFit: 'contain' }}
            />
          )}
        </div>
      </div>

      <div className="broadcaster-info">
        {getBroadcasterInfo()}
      </div>

      <div style={{ marginTop: '12px', textAlign: 'right' }}>
        <a 
          href={`/matches/${fixture.id}`} 
          style={{ 
            color: '#6366f1', 
            textDecoration: 'underline', 
            fontSize: '0.9rem',
            fontWeight: '500'
          }}
        >
          Details â†’
        </a>
      </div>
    </div>
  );
};

export default FixtureCard;
